                    ListaAnalisePostura[i].Index = contador;
                    ListaAux[contador] = ListaAnalisePostura[i];
                    contador++;
                }
            }

            ListaAnalisePostura.splice(0, ListaAnalisePostura.length);

            ListaAnalisePostura = ListaAux;

            indiceAnalise = contador;

